import React from 'react';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to Token Flight</h1>
      </header>
      <main>
        <p>Token distribution system coming soon!</p>
      </main>
    </div>
  );
}

export default App;
